        axios
          .get('http://localhost:8000/moviesss')
          .then((res) => {
            console.log(res.data);
            setData(res.data);
          })
          .catch((error) => {
            console.log(error);
          });
      };
      useEffect(() => {
        getMovies();
      }, []);

